import React from 'react';
import {Link} from 'react-router-dom';

import { Container } from './styles';

import logo from '../../assets/images/logo.svg'

export default function Header() {
  return ( 
    <Container>
      <Link></Link>
      <img src={logo} alt="Rocketshoes"/>
    </Container>
  );
}
